                    </label>
                    <div class="input-group input-group-username">
                        <span class="input-group-addon"><i class="fa fa-user-circle"></i></span>
                        <input type="text" name="username" id="username"
                            class="form-control"
                            value=""
                            placeholder="用户名">
                    </div>

                    <label for="password" class="sr-only">密码</label>
                    <div class="input-group input-group-password">
                        <span class="input-group-addon"><i class="fa fa-lock"></i></span>
                        <input type="password" name="password" id="password" value=""
                            class="form-control"
                            placeholder="密码">
                    </div>

                        <div class="rememberpass m-t-1">
                            <input type="checkbox" name="rememberusername" id="rememberusername" value="1"  />
                            <label for="rememberusername">记住用户名</label>
                        </div>

                    <button type="submit" class="btn btn-primary btn-block" id="loginbtn">登录</button>
                </form>

                <div class="forgetpass m-t-1">
                    <p><a href="https://l.xmu.edu.my/login/forgot_password.php">忘记用户名或密码了?</a></p>
